## Tooltip Component

```jsx
import React, { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

const Tooltip = ({ children, content, position = 'top' }) => {
  const [show, setShow] = useState(false);
  const { setCurrentTooltip } = useContext(TooltipContext);

  const handleShow = () => {
    setShow(true);
    setCurrentTooltip({ position, show });
  };

  const handleHide = () => {
    setShow(false);
    setCurrentTooltip({ position, show: false });
  };

  return (
    <div className="relative">
      <div
        className="cursor-pointer"
        onMouseEnter={handleShow}
        onMouseLeave={handleHide}
      >
        {children}
      </div>
      {show && (
        <div
          className={`absolute z-10 ${
            position === 'top' ? 'top-full' : 'bottom-full'
          } left-1/2 -translate-x-1/2 bg-gray-800 text-white p-2 rounded shadow`}
        >
          {content}
        </div>
      )}
    </div>
  );
};

const TooltipProvider = ({ children }) => {
  const [currentTooltip, setCurrentTooltip] = useState({
    position: 'top',
    show: false,
  });

  return (
    <TooltipContext.Provider value={{ currentTooltip, setCurrentTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { Tooltip, TooltipProvider };
```

## Usage

```jsx
import React from 'react';
import { TooltipProvider } from './Tooltip';
import { Tooltip } from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div className="p-4">
        <div className="flex gap-4">
          <Tooltip content="Tooltip 1">
            <button className="px-4 py-2 bg-blue-500 text-white rounded">
              Tooltip 1
            </button>
          </Tooltip>
          <Tooltip content="Tooltip 2">
            <button className="px-4 py-2 bg-blue-500 text-white rounded">
              Tooltip 2
            </button>
          </Tooltip>
        </div>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

